import React, {useState} from 'react';
import './App.css';

function App() {
  const [debug, setDebug] = useState(false)
  const [text, setText] = useState("")

  function showDebug() {
    if (debug) {
      return "True"
    }
    return "False"
  }

  return (
    <div className="App">
      <button onClick={
        () => {setDebug(!debug)}
      }>
        Set Debug Outputs
      </button>
      <p>Debug state: {}</p>
      <button onClick={
        () => {setText("Hello World")}
      }>
        Set Text to Hello World
      </button>
      <p>Text: {text}</p>
    </div>
  );
}

export default App;
